import logo from "../../assets/images/logo.png";
import "./UsersPage.css";

export default function UsersPage() {
  return (
    <>
      <div className="header">
        <div className="image-container">
          <img src={logo} alt="logoImage"/>
        </div>
        <div className="menu-container">
            <ul>
                <li>Hotels</li>
                <li>Bikes</li>
                <li>Restraunts</li>
            </ul>
        </div>
      </div>


    </>
  );
}
